import React, { useState }from 'react'
import "./Register.css"

const Register = () => {
  const [termsandcondition,settermsandcondition]=useState("terms-false")
  const [data,setdata]=useState({})
  const [numberValidation,setnumberValidation]=useState("number-validity-true")
  const [inputvisibility,setinputvisibility]=useState("input-register")
  const handleRegister=(e)=>{
e.preventDefault()
    console.log(data)
    if(data.Phone.length===10){
      console.log("done")
    }else{
      console.log("num length is not 10")
    }
   
  }

  const handleFormData=(e,id)=>{
setdata({...data,[id]:e.target.value})
if(id==="Phone"){
  let stringnum=data.Phone+""
  if(stringnum.length!==9){
    setnumberValidation("number-validity-false")
  }else{
    setnumberValidation("number-validity-true")
  }
}

console.log(data)
  }

  const getbuttonClass=()=>{
    if(termsandcondition==="terms-false"){
      console.log(termsandcondition)
      settermsandcondition("terms-true")
      return 
    }
    console.log(termsandcondition)
    settermsandcondition("terms-false")
    return 
  }
  return (
    <div id='Register-comp'>
       <div id='Heading-register'>
        register
      </div>
      <form >
  <label className="Label-register" id='Name-label-register' htmlFor="Name-register">Name</label>
<input className={inputvisibility} type="text" required id="Name-register" onChange={(e)=>handleFormData(e,"Name")} ></input>
<label className="Label-register" id='Email-label-register' htmlFor="Email-register">Email</label>
<input className={inputvisibility} type="email" required id="Email-register" onChange={(e)=>handleFormData(e,"Email")}></input>
<label className="Label-register" id='Phone-label-register' htmlFor="Phone-register">Phone</label>
<input className={inputvisibility} type="number" required id="Phone-register" onChange={(e)=>handleFormData(e,"Phone")}></input>
<p className={numberValidation}>Please enter a valid number</p>

<label className="Label-register" id='Password-label-register' htmlFor="Password-register">Password</label>
<input className={inputvisibility} type="password" required id="Password-register" onChange={(e)=>handleFormData(e,"Password")}></input>

<label className="Label-register" id='State-label-register' htmlFor="State-register">State</label>
<select className={inputvisibility}  required id="State-register" onChange={(e)=>handleFormData(e,"State")}>
  <option value="Kerala">Kerala</option>
  <option value="TamilNadu">Tamilnadu</option>
  <option value="Karnataka">Karnataka</option>
</select>

<label className="Label-register" id='District-label-register' htmlFor="District-register">District</label>
<select className={inputvisibility} required id="District-register" onChange={(e)=>handleFormData(e,"District")}>
<option value="Malappuram">Malappuram</option>
<option value="Kozhikode">Kozhikode</option>
<option value="Ernamkulam">Ernamkulam</option>
<option value="Palakkad">Palakkad</option>
<option value="Thrissur">Thrissur</option>
<option value="Kannur">Kannur</option>
<option value="Wayanad">Wayanad</option>
<option value="idukki">idukki</option>
</select>

<label className="Label-register" id='Address-label-register' htmlFor="Address-register">Address</label>
<input className={inputvisibility} type="text" required id="Address-register" onChange={(e)=>handleFormData(e,"Address")}></input>

<label className="Label-register" id='Pincode-label-register' htmlFor="Pincode-register">Pincode</label>
<input className={inputvisibility} type="number" required id="Pincode-register" minLength={6} maxLength={6} onChange={(e)=>handleFormData(e,"Pincode")}></input>

<input type="checkbox" id='checkbox-register' onChange={()=>getbuttonClass()}/>
<p id='Terms-register'>I agree to Terms & Condition receiving marketing and promotional materials</p>
<div id='Button-div-register'><div id='button-content'>Register</div></div><button className={termsandcondition} onClick={(e)=>handleRegister(e)}>Register</button>
</form>
    </div>
  )
}

export default Register
